import React from "react";
import { Route, Navigate, Routes } from "react-router-dom";

export default function ProtectedRoute({
  // eslint-disable-next-line no-useless-rename
  isAuth: isAuth,
  component: Component,
  ...rest
}) {
  return (
    <Routes>
      <Route
        {...rest}
        render={(props) => {
          if (isAuth) {
            return <Component />;
          } else {
            return (
              <Navigate
                to={{
                  pathname: "/adminlogin",
                  status: { from: props.location },
                }}
              />
            );
          }
        }}
      />
    </Routes>
  );
}
